import React from "react";

import "./login.css"

export class Login extends React.Component {

    render() {
        return(
            <div className="loginSiteWrapper">
                <form className="loginFormWrapper">
                    <input className="loginFormInput" type="text" name="email" placeholder="email" required/>
                    <input className="loginFormInput" type="password" name="password" placeholder="password" required/>
                    <input className="loginFormButton" type="submit" value="Log in"/>
                </form>
            </div>
        )
    }

}

export default Login;
